import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { Alert } from 'react-bootstrap';

const TreinoCadastroPage = () => {
    const [workoutData, setWorkoutData] = useState({ name: '', description: '', exercises: [] });
    const [exercises, setExercises] = useState([]);
    const [feedback, setFeedback] = useState({ type: '', message: '' });
    const navigate = useNavigate();

    // Fetch exercises from the API
    useEffect(() => {
        const fetchExercises = async () => {
            const response = await fetch('http://localhost:5000/api/exercises'); // Certifique-se de que essa rota existe
            const data = await response.json();
            setExercises(data);
        };

        fetchExercises();
    }, []);

    const handleChange = (e) => {
        setWorkoutData({ ...workoutData, [e.target.name]: e.target.value });
    };

    const handleExerciseChange = (e, exercise) => {
        const { value } = e.target;
        const setsReps = value.split('/'); // Formato esperado: sets/reps
        const updatedExercises = workoutData.exercises.map((ex) => {
            if (ex.id === exercise.id) {
                return { ...ex, sets: setsReps[0], reps: setsReps[1] };
            }
            return ex;
        });
        setWorkoutData({ ...workoutData, exercises: updatedExercises });
    };

    const addExerciseToWorkout = (exercise) => {
        if (!workoutData.exercises.find((ex) => ex.id === exercise.id)) {
            setWorkoutData({ ...workoutData, exercises: [...workoutData.exercises, { ...exercise, sets: '', reps: '' }] });
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('http://localhost:5000/api/workouts', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(workoutData),
            });

            if (response.ok) {
                setFeedback({ type: 'success', message: 'Treino cadastrado com sucesso!' });
                setTimeout(() => {
                    navigate('/trainers'); // Redireciona para a lista de treinadores após o cadastro
                }, 2000);
            } else {
                setFeedback({ type: 'danger', message: 'Erro ao cadastrar treino. Verifique os dados e tente novamente.' });
            }
        } catch (error) {
            console.error(error);
            setFeedback({ type: 'danger', message: 'Erro ao cadastrar treino. Tente novamente mais tarde.' });
        }
    };

    return (
        <div className="container mt-5">
            <h1 className="text-center text-success">Cadastro de Treino</h1>

            {feedback.message && (
                <Alert variant={feedback.type} onClose={() => setFeedback({ type: '', message: '' })} dismissible>
                    {feedback.message}
                </Alert>
            )}

            <form onSubmit={handleSubmit} className="form-group">
                <input
                    type="text"
                    name="name"
                    placeholder="Nome do Treino"
                    className="form-control mb-3"
                    value={workoutData.name}
                    onChange={handleChange}
                    required
                />
                <textarea
                    name="description"
                    placeholder="Descrição"
                    className="form-control mb-3"
                    value={workoutData.description}
                    onChange={handleChange}
                />
                <h4>Adicionar Exercícios</h4>
                <div>
                    {exercises.map((exercise) => (
                        <div key={exercise.id} className="mb-2">
                            <span>{exercise.name}</span>
                            <button type="button" onClick={() => addExerciseToWorkout(exercise)}>Adicionar</button>
                        </div>
                    ))}
                </div>
                {workoutData.exercises.map((exercise) => (
                    <div key={exercise.id} className="mb-2">
                        <span>{exercise.name}</span>
                        <input
                            type="text"
                            placeholder="Sets/Reps (ex: 3/10)"
                            className="form-control"
                            onChange={(e) => handleExerciseChange(e, exercise)}
                            required
                        />
                    </div>
                ))}
                <button type="submit" className="btn btn-success w-100">Cadastrar Treino</button>
            </form>
        </div>
    );
};

export default TreinoCadastroPage;
